import {Container} from 'native-base';


function MyPlants(props){

    return(
        <Container/>
    );
}

function RiddleTable(props) {
  
    return(<>
        <Table striped>
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Alert</th>
            </tr>
          </thead>
          <tbody>
          </tbody>
        </Table></>
    );
  }
  
  function RiddleRow(props) {
    
    return(
      <Container>
      </Container>
    );
  }
  
  function RiddleData(props) {
  
    return(
      <>
        <td>{props.riddle.question}</td>
        <td>{props.riddle.difficulty}</td>
        {props.loggedIn && <>
        <td>{props.hint > 0 && props.riddle.hint1}</td>
        <td>{props.hint > 1 && props.riddle.hint2}</td>
        <td>{props.riddle.winner !== props.user && props.riddle.winner}{props.riddle.winner === props.user && <>YOU :)</>}</td></>}
        <td>
        {(props.riddle.open===1)? <Button variant='success'>OPEN</Button> : <Button variant='danger'>CLOSED</Button>}  
        </td>
      </>
    );
  }

export default MyPlants;
